import React, { Component } from 'react';
import Image from './Image'


class DisplayFeatureImage extends Component {
    imgInfo = () => {
        console.log(this.props.featureImage);

        if (this.props.featureImage !== null) {
            return this.props.featureImage;
       }
   }
    render() {
        return (
            <div>
                <Image key={this.imgInfo()} imageDetails={this.imgInfo()} handleClick={this.props.featuredClick}/>
            </div>
        );
    }
}

export default DisplayFeatureImage;
